import './App.css';
import Header from './components/Header';
import Main from './components/Main';
import Footer from './components/Footer';
import { BrowserRouter,Routes,Route} from 'react-router-dom';
function App() {
  return (
        <div className="App">
        {
          <>
          <Main/>
          <BrowserRouter>
          <Routes>
            <Route path='/Header' />
           <Header/>
          </Routes>
          <Routes>
           <Footer/>
          </Routes>

          </BrowserRouter>

          </>
      }
     </div>   
);
}
export default App;
